import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({ questions, question,index, getQuestionId, id }){

    const q = getQuestionId(2);

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>
              <p>{q.category}</p>  
        </Paper>
    )
}

export default Question;
